import "./index.css";
import Button from '@mui/material/Button';


const Home =()=>{

return(
    <>
      
     <div className="text">Welcome to <span style={{color:"rgb(0,191,255"}}>RISHI WORLD</span></div>
     <img src="pic3.jpg" alt="Girl in a jacket" width="300" height="300" id="homeImg"/>
     <Button>click me</Button>



    </>
)




}
export default Home;
